INSERT INTO `acx_movie_languages` (`id`, `movie_id`, `language`, `name`, `short_storyline`, `storyline`, `subtitle`, `genre`, `director`, `lang_info`, `lang_movie`) VALUES
(1, 2, 'eng', 'Find your voice', 'Hay, F.4 student from a Band 3 secondary school, is a typical decadent, cranky teenager. He once messes up big time in school,‚ÄØthe principal offers Hay one last chance: to join an experimental Choir project named \"Find Your Voice\", or else he will be kicked out from the school.  \r\n \r\nJust like Hay, the members of the Choir are students‚ÄØcome from 3 different band 3 secondary schools. The choir will compete in the Inter-school singing contest after going through a 9-months boot camp. Hay has no choice but to sing. \r\n \r\nEveryone thinks the project is a mission impossible and even call the teens ‚ÄúWretch‚Äù Choir. Whereas the sudden arrival of Mr. Yim, a prominent American Chinese conductor, turns the table. Yim, vanished from the world for a whole year and re-appeared completely out of the blue, agrees to be the conductor of the Choir. \r\n \r\nBehind every face there is a story. Every Choir will sing its own music of life. When these 33 outcasts meet the strictest drillmaster, through life on life interaction, sweat and tears, what ensemble shall be expected from them? \r\n \r\nFacing the billows of life, how will Yim and‚ÄØ\"Find Your Voice\"‚ÄØsurmount all difficulties to complete the mission‚ÄØand stride onto the stage with their head up high, to sing the most resounding voice with fervency, with love. ', 'Hay, F.4 student from a Band 3 secondary school, is a typical decadent, cranky teenager. He once messes up big time in school,‚ÄØthe principal offers Hay one last chance: to join an experimental Choir project named \"Find Your Voice\", or else he will be kicked out from the school.  \r\n \r\nJust like Hay, the members of the Choir are students‚ÄØcome from 3 different band 3 secondary schools. The choir will compete in the Inter-school singing contest after going through a 9-months boot camp. Hay has no choice but to sing. \r\n \r\nEveryone thinks the project is a mission impossible and even call the teens ‚ÄúWretch‚Äù Choir. Whereas the sudden arrival of Mr. Yim, a prominent American Chinese conductor, turns the table. Yim, vanished from the world for a whole year and re-appeared completely out of the blue, agrees to be the conductor of the Choir. \r\n \r\nBehind every face there is a story. Every Choir will sing its own music of life. When these 33 outcasts meet the strictest drillmaster, through life on life interaction, sweat and tears, what ensemble shall be expected from them? \r\n \r\nFacing the billows of life, how will Yim and‚ÄØ\"Find Your Voice\"‚ÄØsurmount all difficulties to complete the mission‚ÄØand stride onto the stage with their head up high, to sing the most resounding voice with fervency, with love. ', '', 'Drama', 'Adrian Kwan', 'Cantonese', 'Cantonese'),
