(5, 5, 'eng', 'The Movie Demon Slayer: Kimetsu No Yaiba MUGEN TRAIN', 'Falling forever into an endless dream‚Ä¶\r\nTanjiro and the group have completed their rehabilitation training at the Butterfly Mansion, and they arrive to their next mission on the Mugen Train, where over 40 people have disappeared in a very short period of time.\r\nTanjiro and Nezuko, along with Zenitsu and Inosuke, join one of the most powerful swordsmen within the Demon Slayer Corps, Flame Hashira Kyojuro Rengoku, to face the demon aboard the Mugen Train on track to despair.', 'Falling forever into an endless dream‚Ä¶\r\nTanjiro and the group have completed their rehabilitation training at the Butterfly Mansion, and they arrive to their next mission on the Mugen Train, where over 40 people have disappeared in a very short period of time.\r\nTanjiro and Nezuko, along with Zenitsu and Inosuke, join one of the most powerful swordsmen within the Demon Slayer Corps, Flame Hashira Kyojuro Rengoku, to face the demon aboard the Mugen Train on track to despair.', '', 'Animation', 'Haruo Sotozaki', 'Japanese', 'Japanese'),
