(9, 8, 'eng', 'Happiest Season', 'Meeting your girlfriend‚Äôs family for the first time can be tough. Planning to propose at her family‚Äôs annual Christmas dinner - until you realize that they don‚Äôt even know she‚Äôs gay - is even harder. When Abby (Kristen Stewart) learns that Harper (Mackenzie Davis) has kept their relationship a secret from her family, she begins to question the girlfriend she thought she knew. HAPPIEST SEASON is a holiday romantic comedy that hilariously captures the range of emotions tied to wanting your family‚Äôs acceptance, being true to yourself, and trying not to ruin Christmas.', 'Meeting your girlfriend‚Äôs family for the first time can be tough. Planning to propose at her family‚Äôs annual Christmas dinner - until you realize that they don‚Äôt even know she‚Äôs gay - is even harder. When Abby (Kristen Stewart) learns that Harper (Mackenzie Davis) has kept their relationship a secret from her family, she begins to question the girlfriend she thought she knew. HAPPIEST SEASON is a holiday romantic comedy that hilariously captures the range of emotions tied to wanting your family‚Äôs acceptance, being true to yourself, and trying not to ruin Christmas.', '', 'Comedy, Drama', 'Clea DuVall', 'English', 'English'),
