(15, 14, 'eng', 'Crayon Shinchan Movie 2020', 'Floating Kingdom ‚ÄúRakugaki Kingdom‚Äù is powered by graffiti. However, it is facing energy shortage because fewer and fewer people draw on Earth. To save the Kingdom, Minister of Defense summons army to Kasukabe and force children to draw. At the same time, Shin-chan receives a ‚ÄúMiracle Crayon‚Äù, which can bring graffiti to life. Thus, he tries to fight back with his drawings to save Kasukabe. But dark clouds gather during the fight and threatening graffiti‚Äôs life since they will melt in water! Can they save Kasukabe and Rakugaki Kingdom?\r\n', 'Floating Kingdom ‚ÄúRakugaki Kingdom‚Äù is powered by graffiti. However, it is facing energy shortage because fewer and fewer people draw on Earth. To save the Kingdom, Minister of Defense summons army to Kasukabe and force children to draw. At the same time, Shin-chan receives a ‚ÄúMiracle Crayon‚Äù, which can bring graffiti to life. Thus, he tries to fight back with his drawings to save Kasukabe. But dark clouds gather during the fight and threatening graffiti‚Äôs life since they will melt in water! Can they save Kasukabe and Rakugaki Kingdom?\r\n', '', 'Animation', 'Kyogoku Takahiko', 'Cantonese', 'Cantonese'),
