(19, 17, 'eng', 'Shock Wave 2', 'The serial bombings in Hong Kong caused panic in the city. Former EODB officer, Poon Shing-Fung (starring Andy Lau), was found in a coma at the spot of a terrorist bombing attack. His close connections with a villainous terrorist organization, ‚ÄúVendetta‚Äù, made him the prime suspect. As soon as Poon emerged from coma, he was grilled by the Police. Knowing that he would face imprisonment anytime, he had to escape to find out the truth.\r\n\r\nTaking on the lonely road, Poon sought help from his old comrade, EODB officer, Tung Cheuk-Man (starring Sean Lau). Torn between the blurred line of good and evil, but Tung must choose between police duties and friendship. His heart told him that he had to choose the latter, since they had been together in life-and-death. He decided to help Poon.\r\n\r\nMeanwhile, Poon‚Äôs ex-girlfriend Pong Ling (starring Ni Ni), Chief Inspector of CTRU, stopped at nothing to find out the mastermind behind the attacks to ensure safety of the citizens. Pong talked Poon into infiltrating into ‚ÄúVendetta‚Äù, thus finding out the secret organization‚Äôs next terrorist plot. This was the only way that his innocence could be proved.\r\n\r\nIt‚Äôs all too easy to think so‚Ä¶ peeling back the layers to get to the truth was as complicated and difficult as defusing bombs. The clock was ticking‚Ä¶ Poon could lose his life anytime.\r\n', 'The serial bombings in Hong Kong caused panic in the city. Former EODB officer, Poon Shing-Fung (starring Andy Lau), was found in a coma at the spot of a terrorist bombing attack. His close connections with a villainous terrorist organization, ‚ÄúVendetta‚Äù, made him the prime suspect. As soon as Poon emerged from coma, he was grilled by the Police. Knowing that he would face imprisonment anytime, he had to escape to find out the truth.\r\n\r\nTaking on the lonely road, Poon sought help from his old comrade, EODB officer, Tung Cheuk-Man (starring Sean Lau). Torn between the blurred line of good and evil, but Tung must choose between police duties and friendship. His heart told him that he had to choose the latter, since they had been together in life-and-death. He decided to help Poon.\r\n\r\nMeanwhile, Poon‚Äôs ex-girlfriend Pong Ling (starring Ni Ni), Chief Inspector of CTRU, stopped at nothing to find out the mastermind behind the attacks to ensure safety of the citizens. Pong talked Poon into infiltrating into ‚ÄúVendetta‚Äù, thus finding out the secret organization‚Äôs next terrorist plot. This was the only way that his innocence could be proved.\r\n\r\nIt‚Äôs all too easy to think so‚Ä¶ peeling back the layers to get to the truth was as complicated and difficult as defusing bombs. The clock was ticking‚Ä¶ Poon could lose his life anytime.\r\n', '', 'Drama, Disaster', 'Herman Yau', 'Cantonese', 'Cantonese'),
